import React from "react";
import { useNavigate } from "react-router-dom";
import logo from '../Home/Assets/medi.png'
import '../Header/Header.css'


function Header(){
    const navigate1= useNavigate()
    const Home = ()=>{navigate1('/')}

    const navigate2= useNavigate()
    const Facility=()=>{navigate2('/facility')}

    const navigate3= useNavigate()
    const Appointment=()=>{navigate3('/appointment')}


    return(
    <div>
     <header className="nav-head">
        <div className="nav-logo"><img src={logo}></img>
        <h2>Hope Care</h2></div>
        <div className="nav-button">
        
<button onClick={Home}><h6>Home</h6></button>
<button onClick={Facility}><h6>Facility</h6></button>
<button onClick={Appointment}><h6>Appointment</h6></button>
</div>
</header>
    </div>
    )
}

export default Header
